const ChallengeList = ({ challengeList }) => {
  console.log(challengeList);
  return (
    <div className="ChallengeList">
      {challengeList.map((it) => (
        <ChallengeItem key={it.id2} {...it} />
      ))}
    </div>
  );

  challengeList.defaultProps = {
    challengeList: [],
  };
};

export default ChallengeList;
